OMENI, GREECE - MARCH 03:  Refugee men scramble for registration papers at the Greek-Macedonia border on March 03, 2016 in Idomeni, Greece. The transit camp at the border is becoming increasingly overcrowded as thousands of refugees continue to arrive from Athens and the Greek Islands. Macedonia\'s border with Greece remains \'open\' but after allowing 580 refugees a day to cross into the country at the beginning of the week, the numbers passing have fallen dramatically with only a handful every day. According to local authorities approximately 11,000 refugees and migrants now remain stuck at the border as they wait to enter Macedonia to continue their journey North into Western Europe.  (Photo by Dan Kitwood/Getty Images)\";s:17:\"created_timestamp\";s:10:\"1457021756\";s:9:\"copyright\";s:17:\"2016 Getty Images\";s:12:\"focal_length\";s:3:\"135\";s:3:\"iso\";s:4:\"1600\";s:13:\"shutter_speed\";s:8:\"0.003125\";s:5:\"title\";s:66:\"Migrants Continue To Travel North From Athens To Macedonian Border\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),
