(202, 3, '2016-03-06 06:26:31', '2016-03-06 06:26:31', '', 'Migrants Continue To Travel North From Athens To Macedonian Border', 'IDOMENI, GREECE - MARCH 03:  Refugee men scramble for registration papers at the Greek-Macedonia border on March 03, 2016 in Idomeni, Greece. The transit camp at the border is becoming increasingly overcrowded as thousands of refugees continue to arrive from Athens and the Greek Islands. Macedonia\'s border with Greece remains \'open\' but after allowing 580 refugees a day to cross into the country at the beginning of the week, the numbers passing have fallen dramatically with only a handful every day. According to local authorities approximately 11,000 refugees and migrants now remain stuck at the border as they wait to enter Macedonia to continue their journey North into Western Europe.  (Photo by Dan Kitwood/Getty Images)', 'inherit', 'open', 'closed', '', 'migrants-continue-to-travel-north-from-athens-to-macedonian-border', '', '', '2018-07-19 06:42:22', '2018-07-19 06:42:22', '', 0, 'https://demos.famethemes.com/easymag/wp-content/uploads/2016/03/gettyimages-513559306.jpg', 0, 'attachment', 'image/jpeg', 0),
