(252, 3, '2016-03-06 06:56:23', '2016-03-06 06:56:23', '', 'Ford First Quarter Earnings Drop Due To Strong Dollar, Weak Sales', 'COLMA, CA - APRIL 28:  New Ford F-150 pickups are displayed on the sales lot at Serramonte Ford on April 28, 2015 in Colma, California. Ford Motor Co. reported a 6.6 percent drop in first quarter earnings with net income of $924 million, or 23 cents a share, compared to $989 million, or 24 cents, one year ago. A higer than expecte tax rate and factory retooling to accomodate the new aluminum-bodied F-150 pickup contributed to the quarterly decline. The F-Series pickups accounts for 90 percent of Ford\'s global automotive profits.  (Photo by Justin Sullivan/Getty Images)', 'inherit', 'open', 'closed', '', 'ford-first-quarter-earnings-drop-due-to-strong-dollar-weak-sales', '', '', '2018-07-19 06:42:24', '2018-07-19 06:42:24', '', 0, 'https://demos.famethemes.com/easymag/wp-content/uploads/2016/03/471433966.jpg', 0, 'attachment', 'image/jpeg', 0),
