(268, 3, '2016-03-06 07:05:59', '2016-03-06 07:05:59', '', 'McDonald\'s Restaurant In Brazil', 'A Big Mac sandwich is arranged for a photo at a McDonald\'s restaurant in Sao Paulo, Brazil, on Wednesday, Oct. 28, 2009. The Brazilian real\'s 33 percent, world-beating rally this year pushed up the price of a McDonald\'s Corp. Big Mac in Sao Paulo to 8 reais, or $4.60, above the price in New York ($3.99) and London (2.29 pounds, $3.75), a measure that would indicate the currency is overvalued. Photographer: Paulo Fridman/Bloomberg', 'inherit', 'open', 'closed', '', 'mcdonalds-restaurant-in-brazil', '', '', '2018-07-19 06:42:25', '2018-07-19 06:42:25', '', 0, 'https://demos.famethemes.com/easymag/wp-content/uploads/2016/03/mcdonalds-brazil.jpg', 0, 'attachment', 'image/jpeg', 0),
