(644, 1, '2018-07-23 06:43:10', '2018-07-23 06:43:10', 'நியூயார்க்: அமெரிக்காவிடம் மோதுவது குறித்து இனி ஈரான் சிந்தித்து கூட பார்க்க கூடாது, என்று ஈரான் அதிபருக்கு அமெரிக்க அதிபர் டொனால்ட் டிரம்ப் எச்சரிக்கை விடுத்துள்ளார்.\r\n\r\nஈரான் அமெரிக்காவிற்கு இடையிலான பிரச்சனை மீண்டும் தலைதூக்கி இருக்கிறது. சொந்தமாக பெட்ரோலிய வளங்களை எடுக்க ஆரம்பித்த பின்பும், மற்ற பெட்ரோலிய நாடுகளுடனும் நட்பாக ஆன பின்பு, அமெரிக்கா மொத்தமாக ஈரானை கைவிட்டு இருக்கிறது.\r\n\r\nமுக்கியமாக அமெரிக்க அதிபராக டிரம்ப் பதவியேற்றதில் இருந்தே இரண்டு நாட்டு உறவிலும் பெரிய பிரச்சனை நிலவி வருகிறது. ஈரானை அமெரிக்கா எப்போது வேண்டுமானாலும் தாக்க வாய்ப்பு இருப்பதாக கூறப்படுகிறது. இரண்டாவது முறையாக ஈரான் மீது அமெரிக்கா பொருளாதார தடை விதித்துள்ளது. அணு ஆயுதம் வைத்து இருப்பதாக கூறி, ஈரான் மீது இரண்டாவது முறையாக அமெரிக்க பொருளாதார தடை விதித்துள்ளது. இதனால் அமெரிக்காவின் நட்பு நாடுகள், ஈரானில் இருந்து எந்த பொருளையும் இறக்குமதி செய்யாது.\r\n\r\nஇந்த நிலையில் ஈரானில் இருந்து பெட்ரோல், டீசல் வாங்குவதை நட்பு நாடுகள் தவிர்க்க வேண்டும் என்று கூறியுள்ளது. தற்போது அமெரிக்காவின் அறிவுறுத்தலை ஏற்று ஈரானில் இருந்து பெட்ரோல், டீசல் வாங்குவதை தடை செய்ய சில நாடுகள் முடிவெடுத்துள்ளதாக தகவல் வெளியாகி உள்ளது.\r\n\r\nஇந்த நிலையில்தான், அதிபர் டிரம்ப், தனது டிவிட்டர் பக்கத்தில் \'\'ஈரான் அதிபர் ரௌஹானிக்கு, அமெரிக்காவை இன்னொரு முறை மிரட்டி பார்க்க வேண்டாம். இல்லையென்றால், வரலாற்றில் இதற்கு முன்பு நடந்தது போன்ற சம்பவங்களை மீண்டும் அனுபவிக்க நேரிடும். உங்களுடைய வன்முறையான வார்த்தைகளை கேட்டுக்கொண்டிருக்கும் பழைய அமெரிக்கா கிடையாது இது. கவனமாக இருக்குங்கள். \'\' என்று போர் தொடங்கும் பாணியில் மிகவும் கோபமாக எழுதியுள்ளார்.', 'இது பழைய அமெரிக்கா இல்லை, நடப்பதே வேறு.. ஈரானுக்கு பகிரங்க மிரட்டல் விடுத்த டிரம்ப்!', '', 'publish', 'closed', 'closed', '', 'test', '', '', '2018-08-07 09:37:12', '2018-08-07 09:37:12', '', 0, 'http://localhost/wordpress/?page_id=644', 0, 'page', '', 0),
(645, 1, '2018-07-23 06:43:10', '2018-07-23 06:43:10', 'யூயார்க்: அமெரிக்காவிடம் மோதுவது குறித்து இனி ஈரான் சிந்தித்து கூட பார்க்க கூடாது, என்று ஈரான் அதிபருக்கு அமெரிக்க அதிபர் டொனால்ட் டிரம்ப் எச்சரிக்கை விடுத்துள்ளார். ஈரான் அமெரிக்காவிற்கு இடையிலான பிரச்சனை மீண்டும் தலைதூக்கி இருக்கிறது. சொந்தமாக பெட்ரோலிய வளங்களை எடு', 'test', '', 'inherit', 'closed', 'closed', '', '644-revision-v1', '', '', '2018-07-23 06:43:10', '2018-07-23 06:43:10', '', 644, 'http://localhost/wordpress/2018/07/23/644-revision-v1/', 0, 'revision', '', 0),
(647, 1, '2018-08-07 09:37:28', '2018-08-07 09:37:28', 'நியூயார்க்: அமெரிக்காவிடம் மோதுவது குறித்து இனி ஈரான் சிந்தித்து கூட பார்க்க கூடாது, என்று ஈரான் அதிபருக்கு அமெரிக்க அதிபர் டொனால்ட் டிரம்ப் எச்சரிக்கை விடுத்துள்ளார்.\r\n\r\nஈரான் அமெரிக்காவிற்கு இடையிலான பிரச்சனை மீண்டும் தலைதூக்கி இருக்கிறது. சொந்தமாக பெட்ரோலிய வளங்களை எடுக்க ஆரம்பித்த பின்பும், மற்ற பெட்ரோலிய நாடுகளுடனும் நட்பாக ஆன பின்பு, அமெரிக்கா மொத்தமாக ஈரானை கைவிட்டு இருக்கிறது.\r\n\r\nமுக்கியமாக அமெரிக்க அதிபராக டிரம்ப் பதவியேற்றதில் இருந்தே இரண்டு நாட்டு உறவிலும் பெரிய பிரச்சனை நிலவி வருகிறது. ஈரானை அமெரிக்கா எப்போது வேண்டுமானாலும் தாக்க வாய்ப்பு இருப்பதாக கூறப்படுகிறது. இரண்டாவது முறையாக ஈரான் மீது அமெரிக்கா பொருளாதார தடை விதித்துள்ளது. அணு ஆயுதம் வைத்து இருப்பதாக கூறி, ஈரான் மீது இரண்டாவது முறையாக அமெரிக்க பொருளாதார தடை விதித்துள்ளது. இதனால் அமெரிக்காவின் நட்பு நாடுகள், ஈரானில் இருந்து எந்த பொருளையும் இறக்குமதி செய்யாது.\r\n\r\nஇந்த நிலையில் ஈரானில் இருந்து பெட்ரோல், டீசல் வாங்குவதை நட்பு நாடுகள் தவிர்க்க வேண்டும் என்று கூறியுள்ளது. தற்போது அமெரிக்காவின் அறிவுறுத்தலை ஏற்று ஈரானில் இருந்து பெட்ரோல், டீசல் வாங்குவதை தடை செய்ய சில நாடுகள் முடிவெடுத்துள்ளதாக தகவல் வெளியாகி உள்ளது.\r\n\r\nஇந்த நிலையில்தான், அதிபர் டிரம்ப், தனது டிவிட்டர் பக்கத்தில் \'\'ஈரான் அதிபர் ரௌஹானிக்கு, அமெரிக்காவை இன்னொரு முறை மிரட்டி பார்க்க வேண்டாம். இல்லையென்றால், வரலாற்றில் இதற்கு முன்பு நடந்தது போன்ற சம்பவங்களை மீண்டும் அனுபவிக்க நேரிடும். உங்களுடைய வன்முறையான வார்த்தைகளை கேட்டுக்கொண்டிருக்கும் பழைய அமெரிக்கா கிடையாது இது. கவனமாக இருக்குங்கள். \'\' என்று போர் தொடங்கும் பாணியில் மிகவும் கோபமாக எழுதியுள்ளார்.', 'இது பழைய அமெரிக்கா இல்லை, நடப்பதே வேறு.. ஈரானுக்கு பகிரங்க மிரட்டல் விடுத்த டிரம்ப்!', '', 'inherit', 'closed', 'closed', '', '644-autosave-v1', '', '', '2018-08-07 09:37:28', '2018-08-07 09:37:28', '', 644, 'http://localhost/wordpress/2018/07/23/644-autosave-v1/', 0, 'revision', '', 0),
