(714, 1, '2018-08-08 11:49:51', '2018-08-08 11:49:51', '<img class=\"alignnone wp-image-477 size-full\" src=\"https://www.onebookingsystem.com/vilambi/wp-content/uploads/2016/03/1280px-Lula_Al-Assad_Itamaraty_2010.jpg\" alt=\"\" width=\"1280\" height=\"873\" />\r\n\r\nலண்டன்: இங்கிலாந்தைச் சேர்ந்த ஆர்சனெல் கால்பந்து கிளப் அணியின் உரிமையாளர் ஸ்டான் குரோயன்கே, கிளப்பின் 30 சதவீதப் பங்கை ரூ. 16 ஆயிரம் கோடிக்கு அலிஷர் உஸ்மனோவிடம் இருந்து வாங்குகிறார். இங்கிலாந்தைச் சேர்ந்த ஆர்சனெல் கால்பந்து கிளப் அணி, மிகவும் பிரபலமான அணியாகும். இந்த கிளப்பின் 67 சதவீதப் பங்கை அதன் உரிமையாளர் ஸ்டான் குரோயன்கே வைத்துள்ளார். மீதமுள்ள 33 சதவீத பங்குகளில் அலிஷர் உஸ்மனோவ் 30 சதவீதத்தை வைத்துள்ளார்.', 'ஆர்சனெல் கால்பந்து அணியின் 30 சதவீத பங்கு.. ரூ.16 ஆயிரம் கோடிக்கு வாங்குகிறார் உரிமையாளர்!', '', 'publish', 'open', 'open', '', '%e0%ae%86%e0%ae%b0%e0%af%8d%e0%ae%9a%e0%ae%a9%e0%af%86%e0%ae%b2%e0%af%8d-%e0%ae%95%e0%ae%be%e0%ae%b2%e0%af%8d%e0%ae%aa%e0%ae%a8%e0%af%8d%e0%ae%a4%e0%af%81-%e0%ae%85%e0%ae%a3%e0%ae%bf%e0%ae%af%e0%ae%bf', '', '', '2018-08-08 11:50:49', '2018-08-08 11:50:49', '', 0, 'https://www.onebookingsystem.com/vilambi/?p=714', 0, 'post', '', 0),
